import Header from "../../components/header"
import ChatSidebar from "./ChatSideBar";
import './ChatPage.css';

const ChatPage = () =>
{
	return (
		<div class="first-line">
				<div class="sub-title">CHANNELS</div>
	<div class="icons">
		<img src="./icons/search-chat.svg" class="search_channel"></img>
		<img src="./icons/add_box.svg" class="add_box add_channel"></img>
	</div>
</div>
	);
};

export default ChatPage;

<div class="first-line">
	<div class="sub-title">CHANNELS</div>
	<div class="icons">
		<img src="./icons/search-chat.svg" class="search_channel"></img>
		<img src="./icons/add_box.svg" class="add_box add_channel"></img>
	</div>
</div>
